import { Component, OnInit } from '@angular/core';
import { Router } from '@angular/router';
import { User } from '../../../model/user';
import { UserService } from '../../../service/user.service';

@Component({
  selector: 'app-create-user',
  templateUrl: './create-user.component.html',
  styleUrls: ['./create-user.component.css']
})
export class CreateUserComponent implements OnInit {

  user: User = new User();


  constructor(private userService: UserService, private router: Router) { }

  ngOnInit(): void {
  }

  saveUser(){
    this.userService.createUser(this.user).subscribe(data=>{
      console.log(data);
      this.goToUserList();
    },
    error => console.log(error));
  }

  goToUserList(){
    this.router.navigate(['/landing-page/user-list'])
  }

  onSubmit(){
    console.log(this.user);
    this.saveUser;

  }
}
<div class="col-md-6 offset-md-3 " style="margin-bottom: 100px;">
  <hr><br>
  <h3 class="text-center"><u>Create User</u></h3>
  <form (ngSubmit) = "saveUser()" >
    <div class="form-group">
      <label>User Name</label>
      <input type="text" class="form-control" id="userName"
        [(ngModel)] = "user.userName" name="userName">
    </div>

    <div class="form-group">
      <label>Password</label>
      <input type="password" class="form-control" id="password"
        [(ngModel)] = "user.password" name="password">
    </div>
    <div class="form-group">
      <label>Role</label>
      <input type="text" class="form-control" id="role"
        [(ngModel)] = "user.role" name="role">
    </div>

    <div class="text-center">
      <button class="btn btn-success " type="submit">Submit</button>
    </div>




  </form>

</div>
